  }

  return (
    <div className='searchbar'>
    <MenuItem className='search'>
     <div className='searchIcon'>
       <SearchIcon />
     </div>
     <InputBase
       placeholder="Search…"
       className={'inputRoot','inputInput'}

       inputProps={{ 'aria-label': 'search' }}
     />
    </MenuItem>
   </div>
  )

}

export default withStyles(useStyles)(PalsSearchBar)
